import React from "react";
import {
  FaGithubSquare,
  FaLinkedin,
  FaInstagramSquare,
  FaPortrait,
} from "react-icons/fa";

function Footer() {
  return (
    <>
      <div className="footer">
        Copyright &copy; {new Date().getFullYear()} Vijay. All Rights Reserved
      </div>
      <div style={{ textAlign: "center" }}>
        <span>
          <FaGithubSquare />
          <FaLinkedin />
          <FaInstagramSquare />
          <FaPortrait />
        </span>
      </div>
    </>
  );
}

export default Footer;
